storiesOf("SearchBar", module).add("SearchBar", () => {
  
  function Parent({ children }: any) {
    const [state, setState] = useState({
      searchOptions: [
        {
          key: "_referencenumber",
          text: "Reference Number",
          value: "referencenumber",
        },
        { key: "_billnumber", text: "Bill Number", value: "billnumber" },
        { key: "_customername", text: "Customer Name", value: "customername" },
        { key: "_customermobile", text: "Mobile", value: "customermobile" },
        { key: "_ltorderid", text: "LT Order ID", value: "ltorderid" },
      ],
      selectedValue: "referencenumber",
      searchInputValue: "Search",
      showSearchBar: false,
    });
    return <div>{children(state, setState)}</div>;
  }
  return (
    <Parent>
      {(
        state: {
          showSearchBar: boolean | null | undefined;
          searchOptions: any[];
          selectedValue: string | null | undefined;
          searchInputValue: string | null | undefined;
        },
        setState: (arg0: any) => void
      ) => (
        <div
          style={{
            width: "400px",
            margin: "120px auto",
          }}
        >
          <div>
            <ButtonWithIcon
              text="Toggle"
              icon={<Icon name="search" size="large" color="grey" />}
              onClick={() => {
                setState({ ...state, showSearchBar: !state.showSearchBar });
              }}
            />
          </div>
          <SearchBar
            searchOptions={state.searchOptions}
            selectedValue={state.selectedValue}
            searchInputValue={state.searchInputValue}
            onDropDownChange={(e) => {
              const item = state.searchOptions.find(
                (cv: { text: any }) => cv.text === e.target.innerText
              );
              setState({ ...state, selectedValue: item.value });
            }}
            onSearchValueChange={(e) => {
              setState({ ...state, searchInputValue: e.target.value });
            }}
            onCrossIconClick={() => {
              setState({ ...state, searchInputValue: "" });
            }}
            showSearchBar={state.showSearchBar!}
          />
        </div>
      )}
    </Parent>
  );
});

